var impalaProfileCases = map[string]struct {
	cfg      *common.Config
	in       common.MapStr
	want     common.MapStr
	wantTime time.Time
	wantErr  bool
}{
	"impala_profile_default": {
		cfg: common.MustNewConfigFrom(common.MapStr{}),
		in: common.MapStr{
			"message": rawLine,
		},
		want: common.MapStr{
			"impala_profile": common.MapStr{
				"timestamp":  timestamp,
				"query_id":   queryId,
				"profile":    profile,
				"domain":     "Impala",
				"eventName":  "Profile",
				"logLevel":   "INFO",
				"threadName": "MAIN",
			},
			"message": rawLine,
		},
	},
	"impala_profile_custom_mapping": {
		cfg: common.MustNewConfigFrom(common.MapStr{
			"const_mappings": common.MapStr{
				"domain":     "Impala",
				"logLevel":   "DEBUG",
				"eventName":  "Profile",
				"threadName": "MAIN",
			},
		}),
		in: common.MapStr{
			"message": rawLine,
		},
		want: common.MapStr{
			"impala_profile": common.MapStr{
				"timestamp":  timestamp,
				"query_id":   queryId,
				"profile":    profile,
				"domain":     "Impala",
				"eventName":  "Profile",
				"logLevel":   "DEBUG",
				"threadName": "MAIN",
			},
			"message": rawLine,
		},
	},
}

func TestImpalaProfile(t *testing.T) {
	for name, tc := range impalaProfileCases {
		tc := tc
		t.Run(name, func(t *testing.T) {
			t.Parallel()

			p, err := New(tc.cfg)
			if err != nil {
				panic(err)
			}
			event := &beat.Event{
				Fields: tc.in,
			}

			got, gotErr := p.Run(event)
			if tc.wantErr {
				assert.Error(t, gotErr)
			} else {
				assert.NoError(t, gotErr)
			}

			assert.Equal(t, tc.want, got.Fields)
		})
	}
}

func BenchmarkSyslog(b *testing.B) {
	for name, bc := range impalaProfileCases {
		bc := bc
		b.Run(name, func(b *testing.B) {
			b.ReportAllocs()
			for i := 0; i < b.N; i++ {

				p, _ := New(bc.cfg)
				event := &beat.Event{
					Fields: bc.in,
				}

				_, _ = p.Run(event)
			}
		})
	}
}

func TestAppendStringField(t *testing.T) {
	tests := map[string]struct {
		inMap   common.MapStr
		inField string
		inValue string
		want    common.MapStr
	}{
		"nil": {
			inMap:   common.MapStr{},
			inField: "error",
			inValue: "foo",
			want: common.MapStr{
				"error": "foo",
			},
		},
		"string": {
			inMap: common.MapStr{
				"error": "foo",
			},
			inField: "error",
			inValue: "bar",
			want: common.MapStr{
				"error": []string{"foo", "bar"},
			},
		},
		"string-slice": {
			inMap: common.MapStr{
				"error": []string{"foo", "bar"},
			},
			inField: "error",
			inValue: "some value",
			want: common.MapStr{
				"error": []string{"foo", "bar", "some value"},
			},
		},
		"interface-slice": {
			inMap: common.MapStr{
				"error": []interface{}{"foo", "bar"},
			},
			inField: "error",
			inValue: "some value",
			want: common.MapStr{
				"error": []interface{}{"foo", "bar", "some value"},
			},
		},
	}

	for name, tc := range tests {
		tc := tc
		t.Run(name, func(t *testing.T) {
			t.Parallel()
			appendStringField(tc.inMap, tc.inField, tc.inValue)

			assert.Equal(t, tc.want, tc.inMap)
		})
	}
}
